import React from "react";
import CircularProgress from "@material-ui/core/CircularProgress";
import unescape from "lodash/unescape";
import { Link } from "react-router-dom";

const Videos = ({ videos, isLoading }) => {
  if (isLoading) {
    return (
      <div>
        <CircularProgress />
      </div>
    );
  }

  if (videos.length === 0) {
    return (
      <div>No videos found. Try to search for another song or artist.</div>
    );
  }

  return (
    <div>
      <ul>
        {videos.map((video) => (
          <Link key={video.id.videoId} to={`/video/${video.id.videoId}`}>
            <li>
                {unescape(video.snippet.title)}
                {video.snippet.thumbnails.default[0]}
            </li>
          </Link>
        ))}
      </ul>
    </div>
  );
};

export default Videos;
